parts:
{
  "name": "UBX-NAV-TIMEUTC",
  "class_id": "0x01",
  "message_id": "0x21",
  "message_type": "periodic_polled",
  "payload_length": {
    "fixed": 20
  },
  "fields": [
    {
      "byte_offset": 0,
      "name": "iTOW",
      "data_type": "U4",
      "unit": "ms",
      "description": "GPS time of week of the navigation epoch. See section iTOW timestamps in the integration manual for details."
    },
    {
      "byte_offset": 4,
      "name": "tAcc",
      "data_type": "U4",
      "unit": "ns",
      "description": "Time accuracy estimate (UTC)"
    },
    {
      "byte_offset": 8,
      "name": "nano",
      "data_type": "I4",
      "unit": "ns",
      "description": "Fraction of second, range -1e9.. 1e9 (UTC)"
    },
    {
      "byte_offset": 12,
      "name": "year",
      "data_type": "U2",
      "unit": "y",
      "description": "Year, range 1999..2099 (UTC)"
    },
    {
      "byte_offset": 14,
      "name": "month",
      "data_type": "U1",
      "unit": "month",
      "description": "Month, range 1..12 (UTC)"
    },
    {
      "byte_offset": 15,
      "name": "day",
      "data_type": "U1",
      "unit": "d",
      "description": "Day of month, range 1..31 (UTC)"
    },
    {
      "byte_offset": 16,
      "name": "hour",
      "data_type": "U1",
      "unit": "h",
      "description": "Hour of day, range 0..23 (UTC)"
    },
    {
      "byte_offset": 17,
      "name": "min",
      "data_type": "U1",
      "unit": "min",
      "description": "Minute of hour, range 0..59 (UTC)"
    },
    {
      "byte_offset": 18,
      "name": "sec",
      "data_type": "U1",
      "unit": "s",
      "description": "Seconds of minute, range 0..60 (UTC)"
    },
    {
      "byte_offset": 19,
      "name": "valid",
      "data_type": "X1",
      "description": "Validity Flags",
      "bitfields": [
        {
          "name": "validTOW",
          "bit_offset": 0,
          "bit_length": 1,
          "data_type": "U1",
          "description": "1 = Valid Time of Week (see section Time validity in the integration manual for details)"
        },
        {
          "name": "validWKN",
          "bit_offset": 1,
          "bit_length": 1,
          "data_type": "U1",
          "description": "1 = Valid Week Number (see section Time validity in the integration manual for details)"
        },
        {
          "name": "validUTC",
          "bit_offset": 2,
          "bit_length": 1,
          "data_type": "U1",
          "description": "1 = Valid UTC Time"
        },
        {
          "name": "authStatus",
          "bit_offset": 3,
          "bit_length": 1,
          "data_type": "U1",
          "description": "Indicates if the parameters used to convert GNSS time into UTC time have been authenticated.",
          "enum_values": [
            {
              "value": 0,
              "description": "Unknown"
            },
            {
              "value": 1,
              "description": "Authenticated"
            }
          ]
        },
        {
          "name": "utcStandard",
          "bit_offset": 4,
          "bit_length": 4,
          "data_type": "U4",
          "description": "UTC standard identifier. (Not supported for protocol versions less than 15.00)",
          "enum_values": [
            {
              "value": 0,
              "description": "Information not available"
            },
            {
              "value": 1,
              "description": "Communications Research Labratory (CRL), Tokyo, Japan"
            },
            {
              "value": 2,
              "description": "National Institute of Standards and Technology (NIST)"
            },
            {
              "value": 3,
              "description": "U.S. Naval Observatory (USNO)"
            },
            {
              "value": 4,
              "description": "International Bureau of Weights and Measures (BIPM)"
            },
            {
              "value": 5,
              "description": "European laboratories"
            },
            {
              "value": 6,
              "description": "Former Soviet Union (SU)"
            },
            {
              "value": 7,
              "description": "National Time Service Center (NTSC), China"
            },
            {
              "value": 8,
              "description": "National Physics Laboratory India (NPLI)"
            },
            {
              "value": 15,
              "description": "Unknown"
            }
          ]
        }
      ]
    }
  ]
}
